.footer {
  background-color: $color-backround;

  &__content {
    padding-bottom: 20px;

    @include smartphone {
      padding-bottom: 30px;
    }
  }

  &__logo {
    display: none;

    @include smartphone {
      display: flex;

      @include gridPage;
      justify-content: center;
      margin-bottom: 60px;
    }
  }

  &__lg {
    display: flex;
    justify-content: center;
    width: 100%;
    grid-column: 4 / 6;
    margin-left: 5px;

    @include hover(transform, scale(1.1));

    @include smalldesktop {
      grid-column: 6 / 8;

    }
  }

  &__arrow {
    grid-column: 8;
    margin: 0 auto;

    @include hover(transform, scale(1.1));

    @include smalldesktop {
      grid-column: 12;
      margin-right: 0;
    }
  }

  &__icons {
    display: flex;
    justify-content: center;
    align-items: center;
    gap: 40px;
    margin-bottom: 20px;

    @include smartphone {
      @include gridPage;
      margin-bottom: 60px;

    }
  }

  &__social {
    grid-column: 4 / 6;
    display: flex;
    justify-content: space-between;
    align-items: center;

    @include smalldesktop {
      grid-column: 6 / 8;
    }
  }

  &__fb {
    @include hover(transform, scale(1.2));
  }

  &__copy {

    @include smartphone {
      @include gridPage;
      margin-left: 15px;
    }
  }

  &__bottom {
    color: $color-bottom;
    text-align: center;

    font-family: $font-family;
    font-size: 14px;
    font-style: normal;
    font-weight: 400;
    line-height: 21px;

    @include smartphone {
      font-weight: 300;
      grid-column: 2 / 8;
    }

    @include smalldesktop {
      grid-column: 4 / 10;
    }
  }
}
